CREATE DEFINER=`root`@`localhost` PROCEDURE `pr_datims_diocese_ins`(
IN p_name varchar(512),
IN p_archbishop_id int,
IN p_vicar_general_id int,
IN p_chancellor_id int,
IN p_address varchar(2048),
IN p_contact_number varchar(256),
IN p_email_address varchar(256),
OUT result_id int
)
BEGIN
	DECLARE is_unique BOOL DEFAULT FALSE;
    DECLARE temp_code VARCHAR(7);
    DECLARE generated_code VARCHAR(7);

    WHILE NOT is_unique DO
        -- Generate random 7 char code from MD5 of UUID()
        SET temp_code = LEFT(MD5(UUID()), 7);

        -- Check uniqueness against your table, e.g. 'your_table' column 'code'
        IF NOT EXISTS (SELECT 1 FROM dioceses WHERE diocese_code COLLATE utf8mb4_unicode_ci = temp_code COLLATE utf8mb4_unicode_ci) THEN
            SET is_unique = TRUE;
        END IF;
    END WHILE;

    SET generated_code = temp_code;
    
    if not exists (select id from dioceses where name COLLATE utf8mb4_unicode_ci = p_name COLLATE utf8mb4_unicode_ci) then
		insert into dioceses(diocese_code, name, archbishop_id, vicar_general_id, chancellor_id, address, contact_number, email_address)
        values(generated_code, p_name, p_archbishop_id, p_vicar_general_id, p_chancellor_id, p_address, p_contact_number, p_email_address);
        
        set result_id = last_insert_id();
    else
		set result_id = 0;
    end if;
    
    select result_id as 'result_id';
END ;;
DELIMITER ;
