CREATE DEFINER=`root`@`localhost` PROCEDURE `pr_datims_diocese_lst`()
BEGIN
	select
		ROW_NUMBER() OVER (ORDER BY d.name) AS row_num,
        d.id as diocese_id,
        d.diocese_code,
        d.name as diocese_name,
        d.archbishop_id,
        case
			when a.middlename is null or a.middlename = '' then CONCAT(a.firstname, ' ', a.lastname, ', ', ac.abbreviation)
            else CONCAT(a.firstname, ' ', left(a.middlename, 1), ' ', a.lastname, ', ', ac.abbreviation)
		end as archbishop_name,
        d.vicar_general_id,
        case
			when v.middlename is null or v.middlename = '' then CONCAT(v.firstname, ' ', v.lastname, ', ', vc.abbreviation)
            else CONCAT(v.firstname, ' ', left(v.middlename, 1), ' ', v.lastname, ', ', vc.abbreviation)
		end as vicar_general_name,
        d.chancellor_id,
        case
			when c.middlename is null or c.middlename = '' then CONCAT(c.firstname, ' ', c.lastname, ', ', cc.abbreviation)
            else CONCAT(c.firstname, ' ', left(c.middlename, 1), ' ', c.lastname, ', ', cc.abbreviation)
		end as chancellor_name,
        d.address,
        d.contact_number,
        d.email_address,
        d.statuscode,
        case
			when d.statuscode = 0 then 'Inactive'
            else 'Active'
		end as statuscode_label
    from dioceses d
