            else CONCAT(v.firstname, ' ', left(v.middlename, 1), ' ', v.lastname, ', ', vc.abbreviation)
		end as vicar_general_name,
        d.chancellor_id,
        case
			when c.middlename is null or c.middlename = '' then CONCAT(c.firstname, ' ', c.lastname, ', ', cc.abbreviation)
            else CONCAT(c.firstname, ' ', left(c.middlename, 1), ' ', c.lastname, ', ', cc.abbreviation)
		end as chancellor_name,
        d.address,
        d.contact_number,
        d.email_address,
        d.statuscode,
        case
			when d.statuscode = 0 then 'Inactive'
            else 'Active'
		end as statuscode_label
    from dioceses d
    left join priest a on a.id = d.archbishop_id
    left join congregation ac on ac.id = a.congregation_id
    left join priest v on v.id = d.vicar_general_id
    left join congregation vc on vc.id = a.congregation_id
    left join priest c on c.id = d.chancellor_id
    left join congregation cc on cc.id = a.congregation_id
    where 	d.name COLLATE utf8mb4_unicode_ci LIKE CONCAT('%', keyword COLLATE utf8mb4_unicode_ci, '%')
    ORDER BY d.name;
