CREATE DEFINER=`root`@`localhost` PROCEDURE `pr_datims_priest_lst_by_keyword`(
IN p_keyword varchar(256)
)
BEGIN
	select
		ROW_NUMBER() OVER (ORDER BY p.firstname, p.lastname) AS row_num,
        p.id as priest_id,
        case
			when p.middlename is null or p.middlename = '' then CONCAT(p.firstname, ' ', p.lastname)
            else CONCAT(p.firstname, ' ', left(p.middlename, 1), '. ', p.lastname)
		end as priest_name,
        c.abbreviation as congregation_abbreviation,
        p.statuscode,
        case
			when p.statuscode = 0 then 'Inactive'
            else 'Active'
		end as statuscode_label
    from priest p
    left join congregation c on c.id = p.congregation_id
    where 	p.lastname COLLATE utf8mb4_unicode_ci LIKE CONCAT('%', p_keyword COLLATE utf8mb4_unicode_ci, '%')
			OR p.firstname COLLATE utf8mb4_unicode_ci LIKE CONCAT('%', p_keyword COLLATE utf8mb4_unicode_ci, '%')
    ORDER BY p.firstname, p.lastname;
END ;;
