CREATE DEFINER=`root`@`localhost` PROCEDURE `pr_datims_priest_select_options`()
BEGIN
	select
		p.id,
        case
			when p.middlename is null or p.middlename = '' then CONCAT(p.firstname, ' ', p.lastname, ', ', c.abbreviation)
            when p.lastname = '(NA)' then 'Not Applicable (NA)'
            when p.middlename is not null or p.middlename != '' then CONCAT(p.firstname, ' ', left(p.middlename, 1), '. ', p.lastname, ', ', c.abbreviation)
		end as priest_name
    from priest p
    left join congregation c on c.id = p.congregation_id
    where p.statuscode = 1;
END ;;
