CREATE DEFINER=`root`@`localhost` PROCEDURE `pr_datims_vicariate_ins`(
IN p_diocese_id int,
IN p_label varchar(256),
OUT result_id int
)
BEGIN
	IF EXISTS (select id from diocese_vicariates where diocese_id = p_diocese_id and label COLLATE utf8mb4_unicode_ci like CONCAT('%', p_label COLLATE utf8mb4_unicode_ci, '%')) then
		set result_id = 1;
    else
		insert into diocese_vicariates(diocese_id, label)
        values(p_diocese_id, p_label);
        
        set result_id = last_insert_id();
    end if;
    
    select result_id as 'result_id';
END ;;
