CREATE DEFINER=`root`@`localhost` PROCEDURE `pr_datims_vicariate_lst_by_keyword`(
IN p_keyword varchar(256)
)
BEGIN
	select
		ROW_NUMBER() OVER (ORDER BY v.label) AS row_num,
		v.id as vicariate_id,
        v.label,
        d.name as diocese_name,
        v.statuscode,
        case
			when v.statuscode = 0 then 'Inactive'
            else 'Active'
		end as statuscode_label
    from diocese_vicariates v
    left join dioceses d ON d.id = v.diocese_id
    where 	v.label COLLATE utf8mb4_unicode_ci LIKE CONCAT('%', p_keyword COLLATE utf8mb4_unicode_ci, '%')
			OR d.name COLLATE utf8mb4_unicode_ci LIKE CONCAT('%', p_keyword COLLATE utf8mb4_unicode_ci, '%')
    ORDER BY v.label;
